import React from 'react';

const MyComponent = () => {
    return (
        <div className="navbar">
            <img src="./images/GINDI-Logo.png" className="" alt=""/>

            <ul>
                <li>צור קשר</li>
                <li>עלינו</li>
                <li className="active">פרויקטים</li>
            </ul>
        </div>
    );
};

export default MyComponent;
